// Projects.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import tunermenucamber from './tuner-menu-camber.png';
import paragonPreview from '../assets/paragon-preview.png';
import { motion } from 'framer-motion';

const Projects: React.FC = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.5
      }
    }
  };

  return (
    <motion.section
      initial="hidden"
      animate="visible"
      variants={containerVariants}
      className="min-h-screen pt-24 pb-12 px-4 bg-gradient-to-b from-slate-900/95 to-slate-800/90"
    >
      <div className="max-w-7xl mx-auto">
        {/* Header Section */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="text-center mb-16"
        >
          <h2 className="text-5xl font-bold text-white mb-6 bg-clip-text text-transparent bg-gradient-to-r from-primary to-blue-400">
            Featured Projects
          </h2>
          <p className="text-gray-300 text-xl max-w-2xl mx-auto">
            Explore my portfolio of web applications and development projects
          </p>
        </motion.div>

        {/* Projects Grid */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 mb-16">
          {/* Portfolio Website Project */}
          <motion.div 
            variants={itemVariants} 
            className="group relative bg-slate-800/40 backdrop-blur-sm p-8 rounded-2xl hover:bg-slate-700/40 transition-all duration-500 transform hover:-translate-y-2 hover:shadow-2xl hover:shadow-primary/20"
          >
            <div className="absolute inset-0 bg-gradient-to-br from-primary/10 to-blue-400/10 rounded-2xl opacity-0 group-hover:opacity-100 transition-opacity duration-500"></div>
            <div className="relative">
              <div className="flex justify-center mb-8">
                <div className="relative w-full h-72 rounded-xl overflow-hidden shadow-xl">
                  <div className="absolute inset-0 bg-gradient-to-br from-slate-900/50 to-slate-800/50 z-10"></div>
                  <img 
                    src={paragonPreview}
                    alt="Portfolio Website" 
                    className="w-full h-full object-cover rounded-xl transform group-hover:scale-105 transition-transform duration-500" 
                  />
                </div>
              </div>
              <div className="text-center">
                <h3 className="text-2xl font-bold mb-4 text-white">Portfolio Website</h3>
                <p className="text-gray-300 mb-6 text-lg">A modern, responsive portfolio built with React and TypeScript</p>
                <Link 
                  to='/portfolio-project' 
                  className="inline-block px-8 py-4 bg-primary/90 text-white font-semibold rounded-xl hover:bg-primary transition-all duration-300 shadow-lg hover:shadow-primary/30"
                >
                  View Project
                </Link>
              </div>
            </div>
          </motion.div>

          {/* FiveM Project */}
          <motion.div 
            variants={itemVariants} 
            className="group relative bg-slate-800/40 backdrop-blur-sm p-8 rounded-2xl hover:bg-slate-700/40 transition-all duration-500 transform hover:-translate-y-2 hover:shadow-2xl hover:shadow-primary/20"
          >
            <div className="absolute inset-0 bg-gradient-to-br from-primary/10 to-blue-400/10 rounded-2xl opacity-0 group-hover:opacity-100 transition-opacity duration-500"></div>
            <div className="relative">
              <div className="flex justify-center mb-8">
                <div className="relative w-full h-72 rounded-xl overflow-hidden shadow-xl">
                  <div className="absolute inset-0 bg-gradient-to-br from-slate-900/50 to-slate-800/50 z-10"></div>
                  <img 
                    src={tunermenucamber} 
                    alt="FiveM Project" 
                    className="w-full h-full object-cover rounded-xl transform group-hover:scale-105 transition-transform duration-500" 
                  />
                </div>
              </div>
              <div className="text-center">
                <h3 className="text-2xl font-bold mb-4 text-white">FiveM Vehicle Tuning Interface</h3>
                <p className="text-gray-300 mb-6 text-lg">A custom UI for vehicle tuning in FiveM servers</p>
                <Link 
                  to='/project1' 
                  className="inline-block px-8 py-4 bg-primary/90 text-white font-semibold rounded-xl hover:bg-primary transition-all duration-300 shadow-lg hover:shadow-primary/30"
                >
                  View Project
                </Link>
              </div>
            </div>
          </motion.div>
        </div>

        {/* Portfolio Repository Link */}
        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.6 }}
          className="text-center border-t border-slate-700/30 pt-12"
        >
          <p className="text-gray-300 font-semibold mb-6 text-lg">
            View the repository for this Website Portfolio
          </p>
          <a 
            href="https://github.com/dasz4376/portfolio" 
            target="_blank"
            rel="noopener noreferrer"
            className="inline-block px-8 py-4 bg-primary/90 text-white font-semibold rounded-xl hover:bg-primary transition-all duration-300 shadow-lg hover:shadow-primary/30"
          >
            View Repository
          </a>
        </motion.div>
      </div>
    </motion.section>
  );
}

export default Projects;
